import React from "react";
import FeedPost from "./FeedPost";





const FeedContainer = () => {

    return (
        <div className="feed_container">
            <div className="feed_container_header">
                <p>ЛЕНТА НОВОСТЕЙ</p>
            </div>
            <div className="feed_container_content">
                <FeedPost post_num={0}/>
            </div>
        </div>
    )
}

export default FeedContainer;
